import "./about.css";

export default function about() {
  return (
    <div className="about">
      <label>ProfileImage</label>

      <label>Name etc..</label>
      <input type="text" className="contentName"></input>
      <label>Career etc..</label>
      <input type="text" className="contentInform"></input>
    </div>
  );
}
